	('e13ee447-7d92-11ec-be40-0242ac120004', 'd48da253-7d92-11ec-be40-0242ac120004', 'S10_1678', '1969 Harley Davidson Ultimate Chopper', '1:10', 'Min Lin Diecast', 'This replica features working kickstand, front suspension, gear-shift lever, footbrake lever, drive chain, wheels and steering. All parts are particularly delicate due to their precise scale and require special care and attention.', 7933, 48.81, 95.70),
