	('e13eec26-7d92-11ec-be40-0242ac120004', 'd48da253-7d92-11ec-be40-0242ac120004', 'S10_2016', '1996 Moto Guzzi 1100i', '1:10', 'Highway 66 Mini Classics', 'Official Moto Guzzi logos and insignias, saddle bags located on side of motorcycle, detailed engine, working steering, working suspension, two leather seats, luggage rack, dual exhaust pipes, small saddle bag located on handle bars, two-tone paint with chrome accents, superior die-cast detail , rotating wheels , working kick stand, diecast metal with plastic parts and baked enamel finish.', 6625, 68.99, 118.94),
	('e13eec6a-7d92-11ec-be40-0242ac120004', 'd48da253-7d92-11ec-be40-0242ac120004', 'S10_4698', '2003 Harley-Davidson Eagle Drag Bike', '1:10', 'Red Start Diecast', 'Model features, official Harley Davidson logos and insignias, detachable rear wheelie bar, heavy diecast metal with resin parts, authentic multi-color tampo-printed graphics, separate engine drive belts, free-turning front fork, rotating tires and rear racing slick, certificate of authenticity, detailed engine, display stand\r\n, precision diecast replica, baked enamel finish, 1:10 scale model, removable fender, seat and tank cover piece for displaying the superior detail of the v-twin engine', 5582, 91.02, 193.66),
	('e13eeca9-7d92-11ec-be40-0242ac120004', 'd48d9fa5-7d92-11ec-be40-0242ac120004', 'S10_4757', '1972 Alfa Romeo GTA', '1:10', 'Motor City Art Classics', 'Features include: Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.', 3252, 85.68, 136.00),
	('e13eecde-7d92-11ec-be40-0242ac120004', 'd48d9fa5-7d92-11ec-be40-0242ac120004', 'S10_4962', '1962 LanciaA Delta 16V', '1:10', 'Second Gear Diecast', 'Features include: Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.', 6791, 103.42, 147.74),
