	('e13eee0f-7d92-11ec-be40-0242ac120004', 'd48da302-7d92-11ec-be40-0242ac120004', 'S12_1666', '1958 Setra Bus', '1:12', 'Welly Diecast Productions', 'Model features 30 windows, skylights & glare resistant glass, working steering system, original logos', 1579, 77.90, 136.67),
	('e13eee45-7d92-11ec-be40-0242ac120004', 'd48da253-7d92-11ec-be40-0242ac120004', 'S12_2823', '2002 Suzuki XREO', '1:12', 'Unimax Art Galleries', 'Official logos and insignias, saddle bags located on side of motorcycle, detailed engine, working steering, working suspension, two leather seats, luggage rack, dual exhaust pipes, small saddle bag located on handle bars, two-tone paint with chrome accents, superior die-cast detail , rotating wheels , working kick stand, diecast metal with plastic parts and baked enamel finish.', 9997, 66.27, 150.62),
	('e13eef0a-7d92-11ec-be40-0242ac120004', 'd48d9fa5-7d92-11ec-be40-0242ac120004', 'S12_3148', '1969 Corvair Monza', '1:18', 'Welly Diecast Productions', '1:18 scale die-cast about 10" long doors open, hood opens, trunk opens and wheels roll', 6906, 89.14, 151.08),
	('e13eef41-7d92-11ec-be40-0242ac120004', 'd48d9fa5-7d92-11ec-be40-0242ac120004', 'S12_3380', '1968 Dodge Charger', '1:12', 'Welly Diecast Productions', '1:12 scale model of a 1968 Dodge Charger. Hood, doors and trunk all open to reveal highly detailed interior features. Steering wheel actually turns the front wheels. Color black', 9123, 75.16, 117.44),
	('e13eef7a-7d92-11ec-be40-0242ac120004', 'd48d9fa5-7d92-11ec-be40-0242ac120004', 'S12_3891', '1969 Ford Falcon', '1:12', 'Second Gear Diecast', 'Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.', 1049, 83.05, 173.02),
	('e13eefb5-7d92-11ec-be40-0242ac120004', 'd48d9fa5-7d92-11ec-be40-0242ac120004', 'S12_3990', '1970 Plymouth Hemi Cuda', '1:12', 'Studio M Art Models', 'Very detailed 1970 Plymouth Cuda model in 1:12 scale. The Cuda is generally accepted as one of the fastest original muscle cars from the 1970s. This model is a reproduction of one of the orginal 652 cars built in 1970. Red color.', 5663, 31.92, 79.80),
	('e13eefeb-7d92-11ec-be40-0242ac120004', 'd48da302-7d92-11ec-be40-0242ac120004', 'S12_4473', '1957 Chevy Pickup', '1:12', 'Exoto Designs', '1:12 scale die-cast about 20" long Hood opens, Rubber wheels', 6125, 55.70, 118.50),
	('e13ef022-7d92-11ec-be40-0242ac120004', 'd48d9fa5-7d92-11ec-be40-0242ac120004', 'S12_4675', '1969 Dodge Charger', '1:12', 'Welly Diecast Productions', 'Detailed model of the 1969 Dodge Charger. This model includes finely detailed interior and exterior features. Painted in red and white.', 7323, 58.73, 115.16),
